import React from 'react';
import Nav from './Nav';
import useFetchUser from './useFetchUser';

const Chart = () => {
    const { user } = useFetchUser();
    return (
        <div>
            <div>
                <Nav user={user} />
            </div>
            <div>
                <div>
                    <table>
                        <thead>
                            <tr>
                                <th>순위</th>
                                <th>곡정보</th>
                                <th>아티스트</th>
                                <th>앨범</th>
                                <th>좋아요</th>
                                <th>즐겨찾기</th>
                            </tr>
                        </thead>
                    </table>
                </div>
            </div>
        </div>
    );
};

export default Chart;
